import React from 'react'
import NavbarComponent from "../Components/Navbar_component";
import Footer from "../Components/Footer"
import ContactComponent from "../Components/ContactComponent";

const Contact = () => {
  return (
    <div>
        <NavbarComponent />
        <ContactComponent />
        <Footer />
    </div>
  )
}

export default Contact
